import { ToDoData } from "./DoData"
import ToDo from "./ToDo"

interface RepeatingDosProps {
    data: ToDoData[]
}

const RepeatingDos = ({ data }: RepeatingDosProps) => {
    const now = new Date()
    console.log("Now: ", now.toUTCString())
    const nowYear = now.getFullYear()
    const nowMonthIndex = now.getMonth()
    const nowMonthDay = now.getDate() + 1
    const dayStart = Date.UTC(nowYear, nowMonthIndex, nowMonthDay)
    console.log("Day Start", new Date(dayStart).toUTCString(), dayStart, nowYear, nowMonthIndex, nowMonthDay)
    return <ul>
        {
            data
                .filter(todo => {
                    console.log(todo, dayStart)
                    return todo.done < dayStart
                })
                .map((todo) => <ToDo key={todo.text} todo={todo} />)
        }
    </ul>
}

export default RepeatingDos
